<body data-c1-topic-id="0991f9e6-3f9a-4fbe-b989-4ee5574596dc">
<h4>ERROR 49: </h4>
<p class="MsoNormal"><b>          
Could not convert target file &lt;TGT File&gt; to 6.3 format. Please convert the 
target file from the Target Explorer.</b></p>
<p class="MsoNormal"> </p>
<p class="t1Text151" style="LINE-HEIGHT: 14pt">Description:</p>
<p class="t2Text2" style="LINE-HEIGHT: 14pt"><span style="FONT-SIZE: 12pt; FONT-FAMILY: 'Times New Roman','serif'">bldmake could 
not convert the TGT due to its complexity.</span></p>
<p class="t1Text151" style="LINE-HEIGHT: 14pt">Resolution:</p>
<p class="t2Text2" style="LINE-HEIGHT: 14pt"><span style="FONT-SIZE: 12pt; FONT-FAMILY: 'Times New Roman','serif'">The open the TGT 
from the Target Explorer to convert it to the 6.3 format.</span></p>
<p class="t2Text2" style="LINE-HEIGHT: 14pt"><span style="FONT-SIZE: 12pt; FONT-FAMILY: 'Times New Roman','serif'"></span> </p><span id="related-topics"></span></body></html>
